import React from 'react';
import './Login.css';


function Login() {
  return (
    <div className="login__container">
    <span>
        <p>“Login Link.” </p>
        <p><a href="http://www.naver.com" target="_blank" rel="noopener noreferer">네이버</a></p>
      </span>
      <span>- George Orwell, 1984</span>
    </div>
  );
}

export default Login;
